import Link from 'next/link'

const PostLink = props => (
    <li>
        <Link href="/item/[id]" as={`/item/${props.param.id}`}>
            <a>{props.param.slug}</a>
        </Link>
    </li>
)

export default function Blog() {
    const obj1 = {
        id: 1,
        slug: 'hello - 1'
    }
    const obj2 = {
        id: 2,
        slug: 'hello - 2'
    }
    const obj3 = {
        id: 3,
        slug: 'hello - 3'
    }
    return (
        <div>
            <h1>My Blog</h1>
            <ul>
                <PostLink param={obj1} />
                <PostLink param={obj2} />
                <PostLink param={obj3} />
            </ul>
        </div>
    )
}
